(811, 11, 8, '<div id="wrap">\n\n    <!-- NAVIGATION -->\n    <nav style="" data-selector="nav" class="navbar bg-color3">\n        <div class=""> \n            <a style="" data-selector="a.btn, a.download-btn, button.btn, a.goto" class="navbar-brand goto propClone" href="#"><span class="drag" style="display: inline-block; position: relative;"><img data-selector="img" src="/elements/images/favicons/apple-touch-icon-72x72.png" alt="Your logo" height="25"></span><span data-selector=".editContent" class="drag editContent" style="display: inline-block; position: relative;"><p style="" data-selector="p">\n	Recruitment Firm\n</p></span></a>\n            <button data-selector="Footer" class="round-toggle navbar-toggle menu-collapse-btn collapsed" data-toggle="collapse" data-target=".navMenuCollapse"> <span class="icon-bar"></span> <span class="icon-bar"></span> <span class="icon-bar"></span> </button>\n            <div class="collapse navbar-collapse navMenuCollapse">\n                <ul style="position: relative; left: -11px; top: 12px;" class="nav drag">\n                    <li data-selector="nav li" class="propClone"><a data-selector="nav a" href="#"><p data-selector="p">\n	Home\n</p></a></li>\n                    <li data-selector="nav li" class="propClone"><a data-selector="nav a" href="#"><p style="" data-selector="p">\n	Job Seekers\n</p></a></li>\n                    <li data-selector="nav li" class="propClone"><a data-selector="nav a" href="#"><p data-selector="p">\n	Employers\n</p></a></li>\n                    <li data-selector="nav li" class="propClone"><a data-selector="nav a" href="#"><p data-selector="p">\n	About Us\n</p></a></li>\n                </ul>\n            </div>\n        </div>\n    </nav>\n\n</div><!-- /#wrap -->\n', 60, 'http://webzero.in/elements/nav.html', 1449836597),
(812, 11, 8, '<div id="wrap">\n\n    <!-- INTRO BLOCK -->\n    <header data-selector="header" src="/elements/images/uploads/10/successful-business-team1.png" id="intro" class="intro-block bg-color1 dark-bg cover-bg" style="background-image: url(&quot;http://webzero.in/elements/images/uploads/10/1f3c0f2.jpg&quot;); background-color: rgb(37, 40, 48); background-repeat: no-repeat; background-size: cover; background-attachment: scroll;">\n        <div class="">\n            <div class="row" style="padding-left: 15px;padding-right: 15px;">\n                <div class="col-md-6"> \n                    <div style="position: relative;" class="logo drag propClone">\n                         \n                    </div>\n                    <div data-selector="Footer" style="position: relative;" class="slogan drag">\n                        <h1 data-selector="h1" src="/elements/images/bg42.jpg" style="color: rgb(255, 255, 255); font-size: 40px; background-color: transparent; margin-bottom: 15px; margin-top: 30px; font-family: Lato;">100''s of Employees Placed\n<br>\n	In Jobs Every Month</h1>\n                        \n                    </div>\n                    \n                    <a src="/elements/images/uploads/10/successful-business-team1.png" style="color: rgb(255, 255, 255); font-size: 13px; background-color: rgb(255, 153, 0);" data-selector="a.btn, a.download-btn, button.btn, a.goto" class="download-btn drag" href="#"><i style="" data-selector=".icon" class="icon icon-android"></i>Looking for a <b>JOB?</b></a><a src="/elements/images/uploads/10/successful-business-team1.png" style="position: relative; left: 10px; top: 0px; color: rgb(255, 255, 255); font-size: 13px; background-color: rgb(0, 134, 134);" data-selector="a.btn, a.download-btn, button.btn, a.goto" class="download-btn drag" href="#"><i style="" data-selector=".icon" class="icon icon-android"></i>Looking for a <b>HIRE</b></a>\n                </div>\n            </div>\n            \n        </div>\n        \n    </header>\n\n</div><!-- /#wrap -->\n', 633, 'http://webzero.in/elements/intro-half-left-app.html', 1449836597),
(813, 11, 8, '\n<div style="height: auto;" id="wrap">\n\n    <!-- CONTENT CENTER 2 BLOCK -->\n    <section data-selector="section" id="content-center-2" class="text-center zero-bottom pattern-bg" style="background-image: url(&quot;/elements/images/pattern-bg2.png&quot;); height: auto;">\n        <div class="container">\n            <div class="row no-dev">\n                <div data-selector=".editContent" style="left: 10.5px; top: 22px;" class="col-sm-6 col-sm-offset-3 sep-bottom editContent drag">\n                    <h2 data-selector="h2" style="position: relative;" class="title drag">Whatever you are looking for, we''ve got it.</h2>\n                    <p data-selector="p" style="position: relative;" class="drag">I''m a paragraph. Click here to add your own text and edit me. It''s easy. Just click “Edit Text” or double click me to add your own content and make changes to the font. Feel free to drag and drop me anywhere you like on your page.I''m a great place for you to tell a story and let your users know a little more about you.<br>\n<br>\nThis is a great space to write long text about your company and your services. You can use this space to go into a little more detail about your company. Talk about your team and what services you provide. Tell your visitors the story of how you came up with the idea for your business and what makes you different from your competitors. Make your company stand out and show your visitors who you are. Tip: Add your own image by double clicking the image and clicking Change Image.</p>\n                </div>\n                <div class="screen col-sm-12 drag">  </div>\n            </div>\n        </div>\n    </section>\n\n</div><!-- /#wrap -->\n', 730, 'http://webzero.in/elements/content-center-2.html', 1449836597),
(814, 11, 8, '<div style="height: auto;" id="wrap">\n\n    <!-- TEXT 2COL BLOCK -->\n    <section data-selector="section" style="height: auto;" id="text-2col">\n        <div class="container">\n            <div class="row">\n                <div style="left: 0px; top: 1px;" data-selector=".editContent" class="col-md-6 editContent drag">\n                    <h3 data-selector="h3" src="/elements/images/center-block-bg2.png" style="color: rgb(0, 134, 134); font-size: 26px; background-color: transparent; margin-bottom: 30px; margin-top: 0px;" class="title">Industries We Serve</h3>\n                    <p data-selector="p">Emotions that causes your project in visitor are no less important ticket to success. Modern solutions, interesting elements, unique approach to details make this template recognizable and interesting. You project will not look like a template bought in a store and adapted within couple of hours. Oh, no! This is not your case. You obtain qualitative, fascinating and juicy final product that is modern and actual. Qualitative and flexible code lays in base of this great product.</p>\n                </div>\n                <div data-selector=".editContent" class="col-md-6 editContent drag">\n                    <h3 data-selector="h3" src="/elements/images/center-block-bg2.png" style="color: rgb(0, 134, 134); font-size: 26px; background-color: transparent; margin-bottom: 30px; margin-top: 0px;" class="title">Recent News</h3>\n                    <p data-selector="p">So, what is the secret of successful template design? First of all, it is its friendliness – both for the template’s owner and for his or her future targeted audience. UX and UI are not just empty phrases for us. It is very important for us that the user could understand correctly the message your project’s trying to say to him or her. But, correct giving of the information is just a half of success.</p>\n                </div>\n            </div>\n        </div>\n    </section>\n\n</div><!-- /#wrap -->\n', 393, 'http://webzero.in/elements/text-2col.html', 1449836597),
(815, 11, 8, '\n<div id="wrap">\n\n    <!-- CONTENT CENTER 2 BLOCK -->\n    <section data-selector="section" src="/elements/images/bg13.jpg" id="content-center-2" class="text-center zero-bottom pattern-bg" style="background-image: url(&quot;http://webzero.in/elements/images/bg13.jpg&quot;);">\n        <div class="container">\n            <div class="row no-dev">\n                <div data-selector=".editContent" style="left: 6.5px; top: 27px;" class="col-sm-6 col-sm-offset-3 sep-bottom editContent drag">\n                    <h2 data-selector="h2" src="/elements/images/bg13.jpg" style="position: relative; color: rgb(255, 255, 255); font-size: 44px; background-color: transparent; margin-bottom: 60px; margin-top: 0px;" class="title drag">Job Seekers</h2>\n                    <p data-selector="p" src="/elements/images/bg13.jpg" style="position: relative; color: rgb(255, 255, 255); font-size: 18px; background-color: transparent;" class="drag">In our work we try to use only the most modern, convenient and interesting solutions. We want the template you downloaded look unique and new for such a long time as it is possible. </p>\n                </div>\n                <div class="screen col-sm-12 drag">  </div>\n            </div>\n        </div>\n    </section>\n\n</div><!-- /#wrap -->\n', 367, 'http://webzero.in/elements/content-center-2.html', 1449836597),
