(818, 11, 8, '<div id="wrap">\n\n    <!-- INTRO SLIDER -->\n    <header data-selector="header" id="intro-slider" class="intro-block full-slider no-sep">\n        <div id="carousel-full-header" class="carousel slide carousel-full" data-ride="carousel">\n\n            <!-- Indicators -->\n            <ol class="carousel-indicators">\n                <li data-target="#carousel-full-header" data-slide-to="0" class="active"></li>\n                <li class="" data-target="#carousel-full-header" data-slide-to="1"></li>\n                <li class="" data-target="#carousel-full-header" data-slide-to="2"></li>\n            </ol>\n\n            <div class="carousel-inner" role="listbox">\n\n                <!-- Slide 1 -->\n                <div data-selector=".editBg" src="/elements/images/uploads/10/shutterst.jpg" class="item cover-bg editBg dark-bg active" style="background-image: url(&quot;http://webzero.in/elements/images/uploads/10/shutterst.jpg&quot;);">\n                    <div style="left: 80px; top: -197px;" class="container double-padding drag">\n                        <div class="row">\n                            <div data-selector=".editContent" src="/elements/images/uploads/10/shutterst.jpg" style="color: rgb(0, 0, 0); font-size: 17px; background-color: transparent; font-family: &quot;Hind&quot;,sans-serif;" class="col-md-5 editContent"><h2 data-selector="h2" src="/elements/images/uploads/10/shutterst.jpg" style="position: relative; color: rgb(255, 153, 0); font-size: 70px; background-color: transparent; margin-bottom: 70px; margin-top: 0px; left: 51px; top: -4px;" class="big-title drag">We deliver <strong>anywhere</strong></h2>\n<p data-selector="p" src="/elements/images/uploads/10/shutterst.jpg" style="position: relative; color: rgb(0, 0, 0); font-size: 18px; background-color: transparent; left: 51px; top: -63px;" class="drag">\n	So, what is the secret of successful template design? First of all, it is its friendliness – both for the template''s owner and for his or her future targeted audience. UX and UI are not just empty phrases for us.\n</p></div>\n                            <div class="col-md-7"></div>\n                        </div>\n                    </div>\n                </div>\n\n                <!-- Slide 2 -->\n                <div data-selector=".editBg" src="/elements/images/uploads/10/archetect-on-construction-site.jpg" class="item editBg cover-bg" style="background-image: url(&quot;http://webzero.in/elements/images/uploads/10/archetect-on-construction-site.jpg&quot;);">\n                    <div class="container double-padding">\n                        <div class="row">\n                            <div class="col-md-6"></div>\n                            <div data-selector=".editContent" style="left: -168px; top: -191px;" class="col-md-6 editContent drag">\n                                <h2 data-selector="h2" style="position: relative;" class="big-title drag"><strong>The Fastest</strong> delivery</h2>\n                                <hr>\n                                <p data-selector="p" style="position: relative;" class="drag">So, what is the secret of successful template design? First of all, it is its friendliness – both for the template’s owner and for his or her future targeted audience. UX and UI are not just empty phrases for us. It is very important for us that the user could understand correctly the message  your project’s trying to say.</p>\n                            </div> \n                        </div>\n                    </div>\n                </div>\n\n                <!-- Slide 3 -->\n                <div data-selector=".editBg" src="/elements/images/uploads/10/url41.jpg" class="item cover-bg editBg dark-bg" style="background-image: url(&quot;http://webzero.in/elements/images/uploads/10/url41.jpg&quot;);">\n                    <div class="container double-padding">\n                        <div class="row">\n                            <div data-selector=".editContent" c