(1995, 18, 14, '\n<div id="wrap">\n\n    <!-- CONTENT HALF LEFT BLOCK -->\n    <section id="content-half-left">\n        <div class="fifty50">\n			<div class="col-lg-4 col-md-5">\n				<div style="position: relative;" class="editContent drag zindex">\n					<h2 style="position: relative;" class="drag">Detailed Design</h2>\n					<h4 style="position: relative;" class="sub-title drag">Modern solution</h4>\n					<p style="position: relative;" class="drag">In our work we try to use only the most modern, convenient and interesting solutions. We want the template you downloaded look unique and new for such a long time as it is possible. </p>\n				</div>\n			</div>\n		</div>	\n        <div src="http://mumbaistreet.s3.amazonaws.com/871FEBA010/Images/ImageWed20012016465186.jpg" class="container-half container-half-right cover-bg" style="background-image: url(&quot;http://mumbaistreet.s3.amazonaws.com/871FEBA010/Images/ImageWed20012016465186.jpg&quot;);"></div>\n    </section>\n\n</div><!-- /#wrap -->\n', 377, 'http://webzero.in/elements/content-half-left.html', 1453286366),
