(1997, 18, 14, '<div id="wrap">\n\n    <!-- TEXT 1COL BLOCK -->\n    <section id="text-1col">\n        <div class="container">\n            <div class="row">\n                <div style="left: 1px; top: -16px;" class="col-md-12 editContent drag">\n                    <h2>FAQ</h2>\n                    <h4 class="sub-title">Sub Title</h4>\n                    <p style="position: relative;" class="drag">So, what is the secret of successful template design? First of all, it is its friendliness – both for the template’s owner and for his or her future targeted audience. UX and UI are not just empty phrases for us. It is very important for us that the user could understand correctly the message your project’s trying to say to him or her. But, correct giving of the information is just a half of success.</p>\n                    <p style="position: relative;" class="drag">Emotions that causes your project in visitor are no less important ticket to success. Modern solutions, interesting elements, unique approach to details make this template recognizable and interesting. You project will not look like a template bought in a store and adapted within couple of hours. Oh, no! This is not your case. You obtain qualitative, fascinating and juicy final product that is modern and actual. Qualitative and flexible code lays in base of this great product.</p>\n                </div>\n            </div>\n        </div>\n    </section>\n\n</div><!-- /#wrap -->\n\n', 415, 'http://webzero.in/elements/text-1col.html', 1453286366),
