(2075, 12, 9, '\n<div id="wrap">\n\n    <!-- CONTACT HALF BLOCK -->\n    <section data-selector="section" id="contact-half" class="bg-color1 cover-bg" style="background-image: url(&quot;/elements/images/bg-map.jpg&quot;);">\n        <div class="container">\n            <div class="row">\n                <div data-selector=".editContent" class="col-md-6 dark-bg editContent drag">\n                    <h2 style="position: relative;" data-selector="h2" class="title drag">Contact Us</h2>\n                    <p style="position: relative;" data-selector="p" class="sep-bottom drag">In our work we try to use only the most modern, convenient and interesting solutions. We want the template you downloaded look unique and new for such a long time as it is possible.</p>\n                    <ul style="position: relative;" class="data-list drag">\n                        <li class="drag"><i data-selector=".icon" class="icon icon-pointer"></i>Kharadi<br>Pune, Maharashtra<br>India</li>\n                        <li class="drag"><i data-selector=".icon" class="icon icon-call-in"></i>+912027012890</li>\n                        <li class="drag"><i data-selector=".icon" class="icon icon-envelope-open"></i>support@jadooweb.com</li>\n                    </ul>\n                </div>\n                <div class="col-md-5 col-md-offset-1 drag">\n                    <div data-selector="#testimonials-grid .quote, .pricing-table, .pricing-table .stamp, .post, .panel, .panel-heading, .form-container, .post-content .price-circle" class="form-container">\n                        <h3 data-selector="h3" class="title">Drop us a line</h3>\n                        <form data-selector="form" action="/elements/scripts/contact.php" role="form" id="contact_form" novalidate="novalidate">\n                            <div class="form-group">\n                                <input class="form-control" id="contact_name" placeholder="Full name" name="name" type="text">\n                            </div>\n  